import React from "react";
import { TransformWrapper, TransformComponent } from "react-zoom-pan-pinch";

const ResultPage = ({ pin }) => {
  return (
    <div>
      <h1>Result Page</h1>
      <TransformWrapper>
        <TransformComponent>
          <div style={{ position: "relative", width: "100%", height: "500px" }}>
            <div
              style={{
                position: "absolute",
                left: pin.x,
                top: pin.y,
                width: "20px",
                height: "20px",
                backgroundColor: "red",
                borderRadius: "50%",
              }}
            ></div>
          </div>
        </TransformComponent>
      </TransformWrapper>
    </div>
  );
};

export default ResultPage;
